import {GitHub} from '@material-ui/icons';
import styled from 'styled-components';

const Container = styled.div`
    position:absolute;
    width:100vw;
    height:100vh;
    background-color:#f2f2b0;
`;
function FirstPage() {
  return (
    <Container>
      <Icon>
        <GitHub/>
      </Icon>
    </Container>
  )
}

export default FirstPage
